import React, { useState } from 'react';

import { useHistory } from 'react-router-dom';




import IconButton from '@mui/material/IconButton';




import { Box, TextField, Button,  Typography, Paper } from '@mui/material';

export default function Signin() {
  
  const [config, setConfig] = useState({
    name: '',
    email:'',
    profession:'',
    password: '',
    confirmpassword:''
  });
  let history = useHistory();
   const signin = (e) => {
      e.preventDefault()
      console.log(config);
        history.push("/");
    }
  const paperStyle = {
    padding: 20,
    height: "55vh",
    width: 360,
    margin: "8% auto",

}
  return (
    <>
      <Box
        className='sec'
        sx={{
          
          width: '400px',
          position: 'absolute',
          left: '30%',
          top: '20%',
        }}
        
      >
         <Paper elevation={10} style={paperStyle}>
        <div className='signin-form'>
         
          <Typography variant='h5' sx={{ mt: 2, ml:17 }} component='h2'>
            Sign in
          </Typography>
          <form className='register-form' id='register-form'>
            <div className='form-group'>
              <Box
                component='form'
                sx={{
                  '& .MuiTextField-root': { m: 1, width: '43ch' },
                }}
                noValidate
                autoComplete='off'
              >
                <TextField
                  required
                  id='outlined-basic'
                  onChange={(e) => setConfig((pv) => ({...pv, name : e.target.value}))} 
                  label='Name'
                 
                  variant='outlined'
                />
              </Box>
            </div>
            <div className='form-group'>
              <Box
                component='form'
                sx={{
                  '& .MuiTextField-root': { m: 1, width: '43ch' },
                }}
                noValidate
                autoComplete='off'
              >
                <TextField
                  required
                  id='outlined-basic'
                  onChange={(e) => setConfig((pv) => ({...pv, email : e.target.value}))} 
                  label='Email'
                  
                  variant='outlined'
                />
              </Box>
            </div>

            <div className='form-group'>
              <Box
                component='form'
                sx={{
                  '& .MuiTextField-root': { m: 1, width: '43ch' },
                }}
                noValidate
               
              >
                {/* <TextField
                  required
                  id='outlined-basic'
                  onChange={(e) => setConfig((pv) => ({...pv, password : e.target.value}))} 
                  label='Password'
                  
                  variant='outlined'
                /> */}
                 <FormControl sx={{ m: 1, width: '25ch' }} variant="outlined">
          <InputLabel htmlFor="outlined-adornment-password">Password</InputLabel>
          <OutlinedInput
            id="outlined-adornment-password"
            type={showPassword ? 'text' : 'password'}
            endAdornment={
              <InputAdornment position="end">
                <IconButton
                  aria-label="toggle password visibility"
                  onClick={handleClickShowPassword}
                  onMouseDown={handleMouseDownPassword}
                  edge="end"
                >
                  {showPassword ? <VisibilityOff /> : <Visibility />}
                </IconButton>
              </InputAdornment>
            }
            label="Password"
          />
        </FormControl>
              </Box>
            </div>

            <div>
              <Button variant='contained' onClick={signin} sx={{
                 ml:17, mt:3
                }}
                noValidate
                >Sign in</Button>
            </div>
          </form>
          
        </div>
        </Paper>
      </Box>
    </>
  );
}
